export const getEvents = (locat) => {
    let myHeader = new Headers();
    myHeader.append("Access-Control-Allow-Origin", "http://localhost:3000/");
    myHeader.append("Content-Type", "text/javascript; charset=utf-8");
    return fetch("http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2", {
        headers: myHeader,
        cache: "no-cache",
        mode: "no-cors"
    }).then((res) => {
        console.log(res);
    });
}
